import React from "react";
import Avatar from "./Avatar";

const User = ({ name, avatar, status, email, width }) => {

  return (
    <div className="row">
      <div className="col-sm-2 profile">
        <Avatar avatar={avatar} />
        <label>{name}</label>
        <label>{status}</label>
        <label>{email}</label>
      </div>
    </div>
  );
};

export default User;
